import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import pageConfig from '../../utils/pageConfig';
import PageHeader from '../../components/PageHeader/PageHeader';
import { getActionsFormate } from '../../utils/common';


class ListPage extends React.Component {

  componentDidMount() {
    const { makeCall, page } = this.props;
    const { components } = pageConfig[page];
    components && components.map(compnt=>{
      const type = compnt.job.PAGE_DATA
        makeCall(type);
    })
  }

  render() {
    const { page } = this.props;
    const { pageTitle, actions, components } = pageConfig[page];
    const { data } = this.props.listData;
    const Components = components && components.map(compnt=>{
      const Component = compnt.component;
      const actions = compnt.actions;
     return(<Component data={data} actions={actions} />)
    })
    return (
      <div className="list-page">
        <PageHeader title={pageTitle} actions={actions} />
        {Components}
        <div>Hello world</div>
      </div>
    );
  }
}

ListPage.propTypes = {
  page: PropTypes.string.isRequired,
  actionType: PropTypes.string.isRequired,
  makeCall: PropTypes.func.isRequired,
  listData: PropTypes.object.isRequired
};

ListPage.defaultProps = {};

const mapStateToProps = state => ({
  listData: state.listReducerStore
});
const mapDispatchToProps = dispatch => {
  return {
    makeCall: (type, data) => {
      dispatch(getActionsFormate(type, data));
    }
  };
};

export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(ListPage)
);
